import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { ADD_TO_ORDED, AddToOrder } from "./store/reducer";

export default function Menu() {
  const arr = ["aaa", "bbb", "ccc", "ddd", "eee"];
  const dispatch = useDispatch();
  useEffect(() => {
    arr.forEach((element) => {
      AddToOrder(element);
      dispatch({
        type: ADD_TO_ORDED,
        payload: element,
      });
    });
  });

  return <div>menua</div>;
}
